webpackJsonp([31752741082535],{8694:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"McDonald's ist online mit SUSE LINUX",date:"13 Nov 2003",slug:"/2003-11-13-mcdonalds-ist-online-mit-suse-linux/",tags:"Y2003"},html:'<p><a title="Ich liebe es" href="http://www.suse.de/de/company/press/press_releases/archive03/mcdonalds.html">McDonald\'s ist online mit SUSE LINUX</a></p>'},next:{fields:{title:"No Room For Children",date:"12 Nov 2003",slug:"/2003-11-12-no-room-for-children/"}},previous:{fields:{title:"Roadster",date:"13 Nov 2003",slug:"/2003-11-13-roadster/"}}},{node:{fields:{title:"No Room For Children",date:"12 Nov 2003",slug:"/2003-11-12-no-room-for-children/",tags:"Y2003"},html:'<p>Two stories in the local paper illustrating how unimportant children are in Germany. <a title="Hamburg: Familie zum Nichtstun verurteilt" href="http://www.abendblatt.de/daten/2003/11/12/229222.html">Family Sentenced to Idleness.</a> Court rejects family\'s application for full-day child care... as self-employed they do not meet the criterea, they can stay home and \'live from unemployment\'. <a title="Zu viele Lehrer krank - Kinder, bleibt zu Hause" href="http://www.abendblatt.de/daten/2003/11/12/229152.html">Too many teachers sick, kids, stay home!</a> Elementary school closes because 5 of 15 teachers are sick, substitutes unavailable for 4 weeks.</p>'},next:{fields:{title:"Progress",date:"11 Nov 2003",slug:"/2003-11-11-progress/"}},previous:{fields:{title:"McDonald's ist online mit SUSE LINUX",date:"13 Nov 2003",slug:"/2003-11-13-mcdonalds-ist-online-mit-suse-linux/"}}},{node:{fields:{title:"Progress",date:"11 Nov 2003",slug:"/2003-11-11-progress/",tags:"Y2003"},html:"<p>Last Easter, just after we returned from our Florida trip, I over 106 kg. I started an Atkins diet, and in 4 weeks I was down to 99 kg. But after 6 weeks I started getting bored with it, and got off  the wagon in early June. </p>\n<p>Then 3-1/2 weeks ago I stepped on the scale and I was back up to 101.6 kg. I decided to start  Atkins again. This morning I was at 96.9 kg, so altogether in 2 stretches I've lost nearly 10 kg, or over 20 lbs.</p>\n<p>I'm documenting this success for myself, in case I should get bored with it again. I'd like to get down to 85 kg if I can.</p>"},next:{fields:{title:"Job Security",date:"11 Nov 2003",slug:"/2003-11-11-job-security/"}},previous:{fields:{title:"No Room For Children",date:"12 Nov 2003",slug:"/2003-11-12-no-room-for-children/"}}}],pathPrefix:"",first:!1,last:!1,index:589,pageCount:1101}}}});
